import { userConstants } from '../_constants';

export function users(state = {}, action) {
  switch (action.type) {
    case userConstants.SET_USERDATA:
      return {  ...action.data };
    case userConstants.SET_CURRENTUSER:
      return {
        ...action.data
      }  
    default:
      return state
  }
}
